    public function load(ObjectManager $manager)
    {
        foreach(self::$DJ_KHALED_KEYS as $index => $key) {
            $post = new Post();
            $post->setTitle("Key $index form DJ Khaled");
            $words = explode(' ', $key);
            $numWords = count($words);
            $post->setDescription(join(' ', array_slice(
                $words,
                mt_rand(1, $numWords - 1),
                20
            )));
            $post->setBody($key);

            $manager->persist($post);
            $manager->flush();
        }
    }
